import React from 'react'
import * as C from './styles'

const ResumeItem = ({ title }) => {
  return (
  <C.Container>
    <C.Header>
      <C.HeaderTitle>Teste</C.HeaderTitle>
    </C.Header>
    <C.Total>1000</C.Total>
  </C.Container>
  )
}

export default ResumeItem
